import React from 'react';
import { connect } from 'react-redux';
import { hideAddForm } from '../../redux/actions';
import './add-form.css';


const AddForm = ({ hideAddForm }) => {
    return (
        <div className='add-form__wrapper'>
            <div className='add-form'>
                <h3 className='add-form__title'>Add new hot-dog</h3>
                <form className='add-form__form'>
                    <input type='text' placeholder='Name'/>
                    <input type='number' placeholder='Price'/>
                    <input type='text' placeholder='Description'/>
                    <input type='text' placeholder='Image url'/>
                    <div className='form__wrapper-btn'>
                        <button onClick={hideAddForm}>No Thanks</button>
                        <button>Add</button>
                    </div>
                </form>
            </div>
        </div>
    );
}

const mapDispatchToProps = {
    // hideAddForm
};

export default connect(
    mapDispatchToProps
)(AddForm);
